#!/bin/bash

READLINK=readlink
if [ "$(uname -s)" = "Darwin" ]
then
	READLINK=greadlink
fi

if ! type -P $READLINK > /dev/null
then
	echo "Missing '$READLINK'. On MacOS run 'brew install coreutils'" >&2
	exit 1
fi

# VARIABLES
ROOT_DIR=$($READLINK -f $(dirname $0))
DOWNLOAD_CACHE=$ROOT_DIR/cache
WORKING_DIR=$ROOT_DIR/work

# Build related params
PREFIX=$ROOT_DIR/graphite # This is a location for all packages
CFLAGS_OPT="-I$PREFIX/include"
if [ ! "$(uname -s)" = "Darwin" ]
then
	LDFLAGS_OPT="-Wl,-rpath=$PREFIX/lib,--enable-new-dtags" 
fi
LDFLAGS_OPT="$LDFLAGS_OPT -L$PREFIX/lib64 -L$PREFIX/lib"

# Tools
CUSTOM_PATH=$PREFIX/bin
CUSTOM_PYTHON=$CUSTOM_PATH/python
CUSTOM_PIP=$CUSTOM_PATH/pip
CUSTOM_XZCAT=$CUSTOM_PATH/xzcat
CUSTOM_FETCH=wget

# HTTP Proxy

# OpenSSL paths
OPENSSL_INCLUDE=$PREFIX/openssl/include
mkdir -p $OPENSSL_INCLUDE
CFLAGS_OPT="$CFLAGS_OPT -I$OPENSSL_INCLUDE"

REQUIRED_PACKAGES=$(cat <<__ | grep -v ^# | sed -e '/^$/d'
