PROG=$(basename $0 .sh)
message() {
	level=$1; shift
	printf "$(date +%Y-%m-%dT%H:%M:%S) $PROG [%s] %s\n" $level $*
}

error() {
	message "ERROR" $* >&2
	exit 1
}

warn() {
	message "WARN" $* >&2
}

info() {
	message "INFO" $*
}

fetch() {
	# Check if already in the cache
	url=$3
	path=$DOWNLOAD_CACHE/$4

	if [ -f $path ]
	then
		info "Found $4 in cache [$path], not downloading"
		return 0
	fi

	info "Downloading $1-$2 from $url to $path"
	$CUSTOM_FETCH -q -O $path "$url"
	
	err=$?
	if [ $err -ne 0 ]
	then
		# Clean-up bad download
		rm -f $path
	fi

	return $err
}

unarchive() {
	app="$1-$2"
	arch=$3
	dir=$4

	# Make sure to create target directory
	mkdir -p $dir

	# Default command
	cmd="tar xf $DOWNLOAD_CACHE/$arch -C $dir"

	### Special case pip - get-pip.py
	case $arch in
	get-pip.py)
		# Copy file to the $dir
		cmd="cp $DOWNLOAD_CACHE/$arch $dir"
	esac
	
	# Get extention
	ext=${arch#${app}.}

	# Figure out command based on the extention
	case $ext in
	tar.xz)
		cmd="$CUSTOM_XZCAT $DOWNLOAD_CACHE/$arch | tar xf - -C $dir"
		;;
	*)
		# NOOP
		;;
	esac

	if [ -d $dir/$app ]
	then
		warn "Found existing '$dir/$app', will not clobber..."
		return 0
	fi

	# Make sure dir exists
	mkdir -p $dir

	info "Unarchiving $app with '$cmd'..."
	if eval "$cmd"
	then
		info "Done"
	else
		error "Failed to unarchive '$app'"
	fi
}

# Make sure WORKING_DIR exists
mkdir -p $WORKING_DIR || error "Unable to create working directory '$WORKING_DIR'"
# Keep log for the installation process
exec 5>$WORKING_DIR/installer.log

buildinstall() {
	app="$1-$2"
	dir=$3

	(
		## Redirect STDIN into STDERR
		exec 2>&1

		## Special case
		case $app in
			pip-*)
				;; # NOOP
			*)
				dir=$dir/$app
		esac

		if [ -d $dir ]
		then
			cd $dir
		else
			error "Unabble to chdir to '$dir'"
		fi

		if [ -f Makefile ] && ! [[ $app =~  ^zlib ]] && ! [[ $app =~ ^openssl ]]
		then
			warn "Detected active project for '$app', will not rebuild"
			warn "If you want to rebuild '$app' run 'rm -rf $dir' first"
		else
			## Make sure local include is used
			mkdir -p $PREFIX/include
			mkdir -p $PREFIX/lib{,64}
			export CPPFLAGS="$CFLAGS_OPT"

			cmd="(test -f Makefile || env LDFLAGS=\"$LDFLAGS_OPT\" ./configure --prefix=$PREFIX) && make && make install"
			# cmd="./configure --prefix=$PREFIX && env LDFLAGS=\"$LDFLAGS_OPT\" make && make install"

			case $app in
			pip*)
				cmd="env LD_LIBRARY_PATH=\"$PREFIX/lib64\" $CUSTOM_PYTHON get-pip.py"
				;;
			pkg-config*)
				cmd="env LDFLAGS=\"$LDFLAGS_OPT\" ./configure --prefix=$PREFIX --with-internal-glib"
				cmd="$cmd && make && make install"
				;;
			glib*)
				cmd="(test -f Makefile || env LDFLAGS=\"$LDFLAGS_OPT\"  ./configure --prefix=$PREFIX --with-libpng=$PREFIX/lib --disable-man)"
				cmd="$cmd && make && make install"
				;;
			Python*)
				cmd="(test -f Makefile || env LDFLAGS=\"$LDFLAGS_OPT\" ./configure --prefix=$PREFIX --enable-shared)"
				cmd="$cmd && make && make install"
				;;
			py2cairo*|pycairo*)
				cmd="$CUSTOM_PYTHON ./waf configure --prefix=$PREFIX"
				cmd="$cmd && $CUSTOM_PYTHON ./waf build"
				cmd="$cmd && $CUSTOM_PYTHON ./waf install"
				cmd="$cmd && $CUSTOM_PYTHON -c 'import cairo; print cairo.version'"
				;;
			zope.interface*|Django*|django-tagging*|Twisted*)
				cmd="$CUSTOM_PIP install ."
				;;
			whisper*|carbon*)
				cmd="test -f setup.cfg && sed -i -e 's|prefix = .*$|prefix = $PREFIX|' setup.cfg"
				cmd="$cmd; $CUSTOM_PYTHON setup.py install"
				;;
			graphite*)
				cmd="test -f setup.cfg && sed -i -e 's|prefix = .*$|prefix = $PREFIX|' setup.cfg"
				cmd="$cmd; $CUSTOM_PYTHON check-dependencies.py"
				cmd="$cmd && $CUSTOM_PYTHON setup.py install --prefix=$PREFIX"
				# cmd="$cmd && $CUSTOM_PYTHON install "
				;;
			openssl*)
				cmd="./config shared --prefix=$PREFIX --openssldir=$PREFIX/ssl-config '$LDFLAGS_OPT'"
				cmd="$cmd && make && make install"
				;;
			apr-util*)
				cmd="(test -f Makefile || env LDFLAGS=\"$LDFLAGS_OPT\"  ./configure --prefix=$PREFIX --with-apr=$PREFIX)"
				cmd="$cmd && make && make install"
				;;
			httpd*)
				cmd="(test -f Makefile || env LDFLAGS=\"$LDFLAGS_OPT\"  ./configure --prefix=$PREFIX/apache --with-apr=$PREFIX --with-apr-util=$PREFIX)"
				cmd="$cmd && make && make install"
				;;
			esac

			info "Running '$cmd' for $app"
			eval "$cmd"
		fi
	) >&5 || error "Failed to build $app"
}

## Exports, glib hack
export PKG_CONFIG_PATH=$PREFIX/bin
export PKG_CONFIG=$PKG_CONFIG_PATH/pkg-config
export PATH=$PREFIX/bin:$PATH
export PYTHONPATH=$PREFIX
export LDFLAGS="$LDFLAGS_OPT"

## Set global field separator -- do not reset
IFS=';'

# 0. Unarchive cache
# Make sure to create DOWNLOAD_CACHE directory
mkdir -p $DOWNLOAD_CACHE || error "Unable to create $DOWNLOAD_CACHE"

info "Unarchiving saved download cache..."
{
	perl -lne '/[_]_XXX__CACHE_ARCHIVE__XXX__/ && $i++ && next; print if $i == 1;' $0 | \
		uudecode -o /dev/stdout | tar xf - -C $DOWNLOAD_CACHE
} && info "Done" || warn "Failed to restore download cache"

# Start building in the correct order
echo "$REQUIRED_PACKAGES" | while read application version url arch
do

	# 1. Get package with wget or from .cache
	[ -z "$arch" ] && arch=$(basename $url)
	# out=$(fetch "$application" "$version" "$url" "$arch" 2>&1)
	fetch "$application" "$version" "$url" "$arch"
	err=$?

	if [ $err -ne 0 ]
	then
		error "Failed to fetch $application-$version from $url"
	fi

	# 2. Unpack into working space
	unarchive "$application" "$version" "$arch" "$WORKING_DIR"
	
	# 3. Configure && build && install
	info "Installing $application-$version..."
	buildinstall "$application" "$version" "$WORKING_DIR" && \
		info "Installed $application-$version"

	# If any previous steps fail, exit with error
done

exit

